export const CounterRedux = (state = { value: 0 }, action) => {
 switch (action.type) {
  case Counter_Increment:
   return { value: state.value + 1 };
  case Counter_Decrement:
   return { value: state.value - 1 };
   case Counter_Reset :
   
    return {value: action.payload.value }
  default:
   return state;
 }
};
